import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { PersonaCard } from '../types';
import { getPersonasByUser } from '../services/personaService';

const avatars = [
  {
    id: '1',
    svg: `<svg viewBox="0 0 100 100" xmlns="http://www.w3.org/2000/svg">
      <circle cx="50" cy="35" r="20" fill="#8B5CF6"/>
      <circle cx="50" cy="100" r="40" fill="#8B5CF6"/>
    </svg>`
  },
  {
    id: '2',
    svg: `<svg viewBox="0 0 100 100" xmlns="http://www.w3.org/2000/svg">
      <rect x="25" y="25" width="50" height="50" rx="10" fill="#8B5CF6"/>
      <rect x="20" y="85" width="60" height="20" rx="10" fill="#8B5CF6"/>
    </svg>`
  },
  {
    id: '3',
    svg: `<svg viewBox="0 0 100 100" xmlns="http://www.w3.org/2000/svg">
      <path d="M50 20 L20 80 L80 80 Z" fill="#8B5CF6"/>
      <circle cx="50" cy="90" r="10" fill="#8B5CF6"/>
    </svg>`
  },
  {
    id: '4',
    svg: `<svg viewBox="0 0 100 100" xmlns="http://www.w3.org/2000/svg">
      <circle cx="50" cy="50" r="40" fill="#8B5CF6"/>
      <circle cx="50" cy="50" r="20" fill="#fff"/>
    </svg>`
  },
  {
    id: '5',
    svg: `<svg viewBox="0 0 100 100" xmlns="http://www.w3.org/2000/svg">
      <rect x="20" y="20" width="60" height="60" rx="30" fill="#8B5CF6"/>
      <rect x="30" y="80" width="40" height="20" rx="10" fill="#8B5CF6"/>
    </svg>`
  },
  {
    id: '6',
    svg: `<svg viewBox="0 0 100 100" xmlns="http://www.w3.org/2000/svg">
      <path d="M50 20 Q70 50 50 80 Q30 50 50 20" fill="#8B5CF6"/>
      <circle cx="50" cy="90" r="10" fill="#8B5CF6"/>
    </svg>`
  }
];

const Profile: React.FC = () => {
  const [personas, setPersonas] = useState<PersonaCard[]>([]);
  const navigate = useNavigate();

  useEffect(() => {
    const loadPersonas = async () => {
      const loadedPersonas = await getPersonasByUser();
      setPersonas(loadedPersonas);
    };
    loadPersonas();
  }, []);

  return (
    <div className="min-h-screen bg-gradient-to-b from-purple-100 to-white py-16">
      <div className="container mx-auto px-4">
        <div className="max-w-4xl mx-auto">
          <div className="flex justify-between items-center mb-8">
            <h1 className="text-3xl font-bold text-purple-900">Мои персонажи</h1>
            <button
              onClick={() => navigate('/play')}
              className="bg-purple-600 text-white px-6 py-2 rounded-lg hover:bg-purple-700 transition-colors"
            >
              Создать нового
            </button>
          </div>

          {personas.length === 0 ? (
            <div className="text-center py-12">
              <p className="text-gray-600 text-lg mb-4">
                У вас пока нет созданных персонажей
              </p>
              <button
                onClick={() => navigate('/play')}
                className="bg-purple-600 text-white px-6 py-2 rounded-lg hover:bg-purple-700 transition-colors"
              >
                Создать первого персонажа
              </button>
            </div>
          ) : (
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
              {personas.map((persona) => {
                const selectedAvatar = avatars.find(a => a.id === persona.avatarUrl);
                return (
                  <div
                    key={persona.id}
                    className="bg-white rounded-lg shadow-lg overflow-hidden hover:shadow-xl transition-shadow cursor-pointer"
                    onClick={() => navigate(`/card/${persona.id}`)}
                  >
                    <div className="bg-purple-50 p-6">
                      <div className="flex justify-center">
                        <div 
                          className="w-24 h-24"
                          dangerouslySetInnerHTML={{ __html: selectedAvatar?.svg || '' }}
                        />
                      </div>
                    </div>
                    <div className="p-6">
                      <h2 className="text-xl font-bold text-purple-900 mb-2">
                        {persona.name}
                      </h2>
                      <p className="text-gray-600">{persona.job}</p>
                    </div>
                  </div>
                );
              })}
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default Profile;
